import React, { Component } from 'react';
import Card from './Card';

class CardList extends Component{
    render(){

        function cardComp(){
            let robots = this.props.robots;
            var arr = [];
            for(var i=0; i<10; i++){
                arr.push(<Card key={i} id={robots[i].id} name={robots[i].name} email={robots[i].email} />);
            }
            return arr;
        }

        return(
            <div>
                {cardComp}
            </div>
        )
    }
}

